import React from 'react';

export default function Dates({ invoiceNumber, invoiceDate, dueDate }) {
  return (
    <>
      <article className="my-5 flex flex-col items-end justify-end">
        <ul>
          <li><span className="font-bold">Numero de facturation:</span> {invoiceNumber}</li>
          <li className=''><span className="font-bold">Date du facturation:</span> {invoiceDate}</li>
          <li><span className="font-bold">Date d'échéance:</span> {dueDate}</li>
        </ul>
      </article>
    </>
  );
}
